import React from "react";
import { Tile } from "../tile/Tile"

export const TileList = ({ items }) => {

  const {name, ...rest} = items

  return (
    <div>
      {
        items.map(item => (
          <Tile
            name={item.name}
            description={item.rest}
          />
        ))
      }
    </div>
  );
};
